import '../../data/models/wallet_balance_dto.dart';class WalletBalance {  WalletBalance({    this.currentBalanceValue,    this.totalPayed,    this.depositValue,    this.pendingAmounts,  });  num? currentBalanceValue;  num? totalPayed;  num? depositValue;  num? pendingAmounts;  factory WalletBalance.fromDto(WalletBalanceDto json) {    return WalletBalance(      currentBalanceValue: json.currentBalanceValue,      totalPayed: json.totalPayed,      depositValue: json.depositValue,      pendingAmounts: json.pendingAmounts,    );  }}